import React from 'react';
import TicketCard from './TicketCard';

const TicketColumn = ({ title, tickets }) => {
  return (
    <div className="column">
      <h3>{title}</h3>
      {tickets.map(ticket => (
        <TicketCard key={ticket.id} ticket={ticket} />
      ))}
    </div>
  );
};

export default TicketColumn;
